import './App.css';
import {Route} from 'react-router-dom';

import Landing from './views/Landing/Landing';
import Home from './views/Home/Home';
import Detail from './views/Detail/Detail';
import Form from './views/Form/CreateActivity';

import Provider from './provider/provider';
import Cards from './components/CardsComponent/Cards';


function App() {

  return (
    <div className="App">
      <Provider>

        <Route exact path='/' component={Landing}></Route>

        <Route exact path='/home' component={Home}></Route><Cards/>

        <Route exact path='/countries/:id' component={Detail} ></Route>

         <Route exact path='/activity' component={Form} ></Route>
<Cards></Cards>
      </Provider>
    </div>
  );
}

export default App;
